(()=>{"use strict";const e=document.getElementById("uid").value,t=document.getElementById("password").value;document.getElementById("sign-in").addEventListener("click",(()=>{const n={uid:e,password:t};fetch("/sign-in",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify(n)}).then((e=>e.json())).then((e=>{"succeed"===e.msg?location.reload():"wrongPassword"===e.msg?alert("잘못된 비밀번호"):"noExist"===e.msg&&alert("존재하지 않는 계정 입니다.")}))}))})();